(8404, 6348, 998, 8, 'Now We Are Free', '', '2007-03-06 00:00:00', 0000, 20, 0, 4, '', 'Anol shalom\nAnol sheh lay konnud de ne um\nFlavum\nNom de leesh\nHam de nam um das\nLa um de\nFlavne\n \nWe de ze zu bu\nWe de sooo a ru\nUn da la pech ni sa\nUn vi-i bee\nUn da la pech ni sa\nUn da la pech ni sa\nUn di-i lay na day\nUn ma la pech a nay\nmee di nu ku\n \nLa la da pa da le na da na\nVe va da pa da le na la dumda\n \nLa la da pa da le na da na\nVe va da pa da le na la dumda\n \nLa la da pa da le na da na\nVe va da pa da le na la dumda\n \nLa la da pa da le na da na\nVe va da pa da le na la dumda\n \nAnol shalom\nAnol sheh ley kon-nud de ne um.\nFlavum\nFlavum\nM-ai shondol-lee\nFlavu\nLof flesh lay\nNof ne\nNom de lis\nHam de num um dass\nLa um de\nFlavne\nFlay\nShom de nomm\nMa-lun des\nDwondi\nDwondi\nAlas sharum du koos\nShaley koot-tum\n \n(Translation following:)\n \nAlmighty Freedom\nAlmighty freer of the soul\nBe free\nWalk with me\nThrough the golden fields\nSo lovely\nLovely\n \nWe regret our sins, but...\nWe sew our own fate and\nUnder my face I remain feeble\nUnder my face, I smile\n \nAaahh)\n \nEven alone/afraid\nUnder my face I will be waiting\n \nRun with me now soldier of Rome\nRun and play in the field with the ponies\nRun with me now soldier of Rome\nRun and play in the field with the ponies\nRun with me now soldier of Rome\nRun and play in the field with the ponies\nRun with me now soldier of Rome\nRun and play in the field with the ponies\n \nAlmighty Freedom\nAlmighty freeer of the soul\nBe free\nBe free\nAnd imagine\nFree with peace at last\nIt''s lovely\nIt''s lovely, this land\nNo one can believe or understand\nHow far I came just for my lovely family\nI should have been there\nwith them when the world crashed down\nBut now they rest with me.\n \nI''ll never forget\nHow I felt that moment\nI became free', 264, '', '', '', '', '', '', 1, 1, 0, '2008-10-16 17:56:57', '2015-03-12 13:34:35', '0000-00-00 00:00:00'),
