(8424, 6339, 1000, 1, '愛情夾在麵包裡', '', '2008-09-12 00:00:00', 0000, 20, 0, 7, '', '甜言蜜語糖塞這空間\n緊皺眉頭想躲在月球後面\n以為這樣可以不面對\n鏡中的臉吃飽了狼狽\n想要嘔吐戲劇化情節\n不合就不要浪費時間\n\n愛情夾在麵包裡面\n或許這樣比較安全\n誰稀罕超廉價誓言\n其實我並不醬認為\n走進心情好便利商店\n寧願吃一碗泡麵\n\n未來存在著許多變卦\n情歌唱了一半便覺得肉麻\n你是烈焰我是冰霜\n感覺像是一本格林童話\n躺在救護車上面的擔架\n結局是奄奄一息呀!\n\n愛情夾在麵包裡面\n或許這樣比較安全\n誰需要超廉價誓言\n其實我並不醬認為\n走進心情好便利商店\n寧願吃一碗泡麵\n\n誰用一把把銳利刀片\n誰用一把把銳利刀片\n把浪漫切割成細細的疲倦\n藏在王子的外套口袋\n還有公主生繡的皇冠\nLet''s Go\n\n愛情夾在麵包裡面\n或許這樣比較安全\n誰需要超廉價誓言\n其實我並不醬認為\n走進心情好便利商店\n寧願吃一碗泡麵', 305, '', '陳如山', '陳如山', '', '亞神音樂', '', 1, 1, 0, '2008-10-17 13:13:46', '2015-03-12 13:34:35', '0000-00-00 00:00:00'),
